import React from 'react';
import Homepage from './components/Homepage';
import Categoryside from './components/Categoryside';
import { useState, useEffect } from 'react';
import axios from 'axios';
import { Category} from './types/category';
import { Equipment } from './types/equipment';
import EquipmentList from './components/Equipment';
import {Routes, Route} from 'react-router-dom';

function App() {

  const [categories, setCategories] = useState<Category[]>([]);

  useEffect(() => {
    const url = "http://localhost:8080/categories";
    axios.get(url).then((res) => {
      setCategories(res.data);
  });
}, []);

  return (
    <>
      <Homepage></Homepage>
      <Categoryside categories={categories}></Categoryside>
      <hr></hr>
      <Routes>
        <Route path='/laptop' Component={EquipmentList}></Route>
        <ul>
        {categories && categories.map(cat => (
          <li key={cat._id}>
            <a href={"/" + cat.slug}>{cat.title}</a>
          </li>
        ))}
      </ul>
      </Routes>
    </>
  );
}

export default App;
